import React, { Component } from 'react';
import './Tickers.css';

class Tickers extends Component {

        constructor(props) {
            super(props);
            this.state = {
                data: [
                    {
                        id: "bitcoin",
                        name: "Bitcoin",
                        symbol: "BTC",
                        price_usd: "1",
                        percent_change_1h: "0",
                        percent_change_24h: "0",
                        percent_change_7d: "0"
                    },
                    {
                        id: "ethereum",
                        name: "Ethereum",
                        symbol: "ETH",
                        price_usd: "1",
                        percent_change_1h: "0",
                        percent_change_24h: "0",
                        percent_change_7d: "0",
                    },
                    {
                        id: "litecoin",
                        price: "1"
                    }
                ]
            };
        }

        render() {
            var tickers = this.state.data.map((currency) =>
                    <li key={currency.id}>
                    <h3>{currency.id}</h3>
                    <h4>{currency.price_usd} USD</h4>
                </li>
            );
            return (
                <div className="tickers-container">
                    <ul className="tickers">{tickers}</ul>
                    <p></p>
               </div>
            );
        }
    }

    export default Tickers;
